import React from "react";
import Header from "./header";
import Scripts from "./bottomContainer";
import MediaCard from "./Card";

function Project() {

    const fullDiv = {
        "margin": "10%",
    }

    return (
        <div>
            <Header></Header>
            <div class="container-fluid">

            <div style={fullDiv} class="row">

                <div class="col-lg-4 col-md-6 col-sm-6 themes-img">
                <MediaCard 
                    title="Lizard"
                    desc="Lizards are a widespread group of squamate reptiles, with over 6,000
                    species, ranging across all continents except Antarctica"
                    title="Lizard"
                />
                </div>

                <div class="col-lg-4 col-md-6 col-sm-6 themes-img">
                <MediaCard></MediaCard>
                </div>

                <div class="col-lg-4 col-md-6 col-sm-6 themes-img">
                <MediaCard></MediaCard>
                </div>

            </div>

            </div>
            <Scripts></Scripts>
        </div>
    )
};

export default Project;
